import logo from './logo.png';
import bg from './bg.png';
import './App.css';

function App() {
  return (
    <div>
      <div style={{backgroundImage: `url("${bg}")`}}></div>
      <div>
        <a href="/">
          <img src={logo} alt=""/>
        </a>
        <div>Performance Marketing Agency</div>
      </div>
    </div>
  );
}

export default App;
